(* ### Problem
 The dartboard below has a radius of 6 inches. Each of the concentric circles has a radius two inches less than the next larger circle. If nine darts land randomly on the target, how many darts would we expect to land in a non-shaded region?

[asy]import graph;
fill(Circle((0,0),15),gray(0.7));
fill(Circle((0,0),10),white);
draw(Circle((0,0),20));
draw(Circle((0,0),15));
draw(Circle((0,0),10));
[/asy] The final Answer is 6
 ### Proof
 The probability for a single dart to land in the non-shaded region is the ratio of the area of the non-shaded region to the area of the entire dartboard. The area of the entire dartboard is $\pi \cdot 6^2 = 36\pi$.
 The area of the shaded region is the area of the second largest circle minus the area of the smallest circle, or $\pi \cdot 4^2 - \pi \cdot 2^2 = 12 \pi$, so the area of the non-shaded region is $36\pi - 12\pi = 24\pi$.
 Thus, our ratio is $\frac{24\pi}{36\pi}=\frac{2}{3}$. If each dart has a $\frac{2}{3}$ chance of landing in a non-shaded region and there are 9 darts, then the expected number of darts that land in a non-shaded region is $9 \cdot \frac{2}{3} = \boxed{6}$.
 *)

theorem
fixes prob_non_shaded :: real
assumes h0 : "prob_non_shaded = 1 - (pi * 15 powr 2) / (pi * 20 powr 2)"
shows  "9 * prob_non_shaded = 6"
 proof- 
  show ?thesis sledgehammer

